import React, { Component } from 'react';

import ChatBot from 'react-simple-chatbot';
import { ThemeProvider } from 'styled-components';

//steps
import steps from './components/steps';

//logos
import kushy_avatar from './images/thkoelnmask.png';

//theme
import chat_styles from './components/chattheme'



import './assets/css/bootstrap-grid.min.css';

class App extends Component {
  render() {
    return (
      <div className="App">

            <ThemeProvider theme={chat_styles}>
               <ChatBot 
                  speechSynthesis={{ enable: true, lang: 'de' }}
                  steps={steps} 
                  headerTitle="LearnBot by Furkan Öztürk"

                  placeholder="Eingabe.."
                  customDelay="500"
                  botAvatar={kushy_avatar}




                />
            </ThemeProvider>

        </div>
    );
  }

}

export default App;
